Test cases must be prepended with prove_ and the testing contract must inherit from Test from Forge's standard test library . First, import Test: import {Test} from "forge-std/Test.sol"; and then inherit from it via ... is Test. This allows hevm to discover the test cases it needs to run. Like so: pragma solidity ^0.8.19;
import {Test} from "forge-std/Test.sol";
contract BadVaultTest is Test { function prove_mytest() { // environment setup, preconditions // call(s) to test // postcondition checks }
} Once you have written such a test case, you need to compile with forge build --ast (see forge documentation for more details) and then: $ hevm test
Checking 1 function(s) in contract src/badvault-test.sol:BadVault
[RUNNING] prove_mytest(uint256) [PASS] prove_mytest(uint256) Here, hevm discovered the test case, and automatically checked it for violations.

