Tests usually need to set up the environment in a particular way, such as contract address, storage, etc. This can be done via Cheat Codes that can change the address of the caller, set block number, etc. See Cheat Codes below for a range of cheat codes supported. Cheat Codes are a standard method used by other tools, such as Foundry , so you should be able to re-use your existing setup. An example setup could be: pragma solidity ^0.8.19;
import {Test} from "forge-std/Test.sol";
contract BadVaultTest is Test { MyVault vault; function setUp() public { // Set up environment vault = new BadVault(); address user1 = address(1); vm.deal(user1, 1 ether); vm.prank(user1); vault.deposit{value: 1 ether}(); address user2 = address(2); vm.deal(user2, 1 ether); vm.prank(user2); vault.deposit{value: 1 ether}(); address attacker = address(42); vm.prank(attacker); // call(s) to test // postcondition checks }
} The postconditions should check the state of the contract after the call(s) are complete. In particular, it should check that the changes that the function applied did not break any of the (invariants)[https://en.wikipedia.org/wiki/Invariant_(mathematics)] of the contract, such as total number of tokens. You can read more about testing and cheat codes in the (Foundry Book)[https://book.getfoundry.sh/forge/cheatcodes] and you can see the hevm-supported cheat codes below .

