Hevm assumes that a test case should not always revert. If you have such a test case, hevm will warn you and return a FAIL. For example this toy contract: pragma solidity ^0.8.19;
import {Test} from "forge-std/Test.sol";
contract MyContract is Test { uint256 cntr; function prove_allrevert(uint256 val) public { if(val < 0) { unchecked { cntr = val; } revert(); } else revert(); }
} When compiled with forge and then ran under hevm with hevm test, hevm returns: Checking 1 function(s) in contract src/contract-allrevert.sol:MyContract
[RUNNING] prove_allrevert(uint256) [FAIL] prove_allrevert(uint256) Reason: No reachable assertion violations, but all branches reverted Prefix this testname with `proveFail` if this is expected This is sometimes undesirable. In these cases, prefix your contract with proveFail_ instead of prove_: pragma solidity ^0.8.19;
import {Test} from "forge-std/Test.sol";
contract MyContract is Test { uint256 cntr; function proveFail_allrevert_expected(uint256 val) public { if(val < 0) { unchecked { cntr = val; cntr += 1; } revert(); } else revert(); }
} When this is compiled with forge and then checked with hevm, it leads to: Checking 1 function(s) in contract src/contract-allrevert-expected.sol:MyContract
[RUNNING] proveFail_allrevert_expected(uint256) [PASS] proveFail_allrevert_expected(uint256) Which is now the expected outcome.

