Let's see this toy contract, in file contract1.sol : //SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;
contract MyContract { mapping (address => uint) balances; function my_adder(address recv, uint amt) public { if (balances[recv] + amt >= 100) { revert(); } balances[recv] += amt; }
} And this, slightly modified one, in file contract2.sol : //SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;
contract MyContract { mapping (address => uint) balances; function my_adder(address recv, uint amt) public { if (balances[recv] + amt >= 100) { revert(); } balances[recv] += amt/2; balances[recv] += amt/2; }
} Now ask hevm if they are equivalent. First, let's compile both contracts and get their bytecode: bytecode1=$(solc --bin-runtime "contract1.sol" | tail -n1)
bytecode2=$(solc --bin-runtime "contract2.sol" | tail -n1) Let's ask hevm to compare the two: $ hevm equivalence \ --code-a $(solc --bin-runtime "contract1.sol" | tail -n1) \ --code-b $(solc --bin-runtime "contract2.sol" | tail -n1)
