The initial store state of hevm is completely abstract. This means that the functions are explored for all possible values of the state. Let's take the following contract contract-symb-3.sol : //SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;
contract MyContract { uint i; function simple_symb() public view { assert(i == 0); }
} Let's compile with solc: solc --bin-runtime contract-symb-3.sol ======= contract-symb-3.sol:MyContract =======
Binary of the runtime part:
6080604052348015600e575f80fd5b50600436106026575f3560e01c806388.... With default symbolic execution, a counterexample is found: $ cabal hevm symbolic --initial-storage Empty --code "60806040523...." Discovered the following counterexamples: Calldata: 0x881fc77c Storage: Addr SymAddr "entrypoint": [(0x0,0x1)] Addr SymAddr "miner": [] Addr SymAddr "origin": [] Transaction Context: TxValue: 0x0 However, notice that the counterexample has 1 as the value for i storage variable. However, this contract can never actually assign i to any value. Running this contract with --initial-state Empty ensures that the default value, 0, is assigned, and the assert can never fail: cabal run exe:hevm -- symbolic --initial-storage Empty --code "60806040...." QED: No reachable property violations discovered Here, no counterexamples are discovered, because with empty default state, the value of i is zero, and therefore assert(i == 0) will all never trigger.
